def write_csv(path,info):
    with open(path, 'r') as re:
        read_info = []
        csv_read = csv.reader(re)
        try:
            for line in csv_read:
                read_info.append(line)
        except:
            pass
    re.close()

    with open(path,'w',newline='') as we:
        csv_write = csv.writer(we)
        if len(read_info)<10:
            info_dict_low = sorted(info.items(), key=lambda d: d[0])
            for info_index,info_text in enumerate(info_dict_low):
                w_info = []
                w_info.append(str(info_index))
                w_info.append(info_text[0] +'\t')
                s = w_info +info_text[1]
                # print(s)
                csv_write.writerow(s)
        else:
            for gp_id in read_info:
                try:
                    ss = info[gp_id[1][:6]]
                except:
                    ss = []
                # print(gp_id ,ss)
                csv_write.writerow( gp_id + ss)
    we.close()
    # pass



def write_info(path , name, sj , info):
    book = xlrd.open_workbook(path)  # 打开一个工作表
    try:
        sheet1 = book.sheet_by_name(name)  # 通过索引获取表
    except:
        bookad = copy(book)
        Sheetad = bookad.add_sheet(name)
        Sheetad.write(0, 0, '序号')
        Sheetad.write(0, 1, 'gp')
        # 在0行0列写入一行数据
        for i in range(1,1000):
            Sheetad.write(i, 0 , i)
        bookad.save(path)
        book = xlrd.open_workbook(path)  # 打开一个工作表
        sheet1 = book.sheet_by_name(name)  # 通过索引获取表

    ncol = sheet1.ncols  # 表的列数
    gp = [i for i in sheet1.col_values(1) if len(i) >0]
    nrow = len(gp)
    gp = gp[1:]
    book2 = copy(book)
    sheet0 = book2.get_sheet(name)
    sheet0.write(0,ncol,sj)



    for gp_index,gp_id in enumerate(gp):
        for info_text_index,info_text in enumerate(info[gp_id]):
            sheet0.write(gp_index + 1, ncol+info_text_index, info_text)
        del info[gp_id]

    if info != None:
        info_dict = sorted(info.items(), key=lambda d: d[0])
        for key_index,key in enumerate(info_dict):
            sheet0.write(nrow + key_index, 1, key[0])
            for value_inder,value in enumerate(key[1]):
                sheet0.write(nrow + key_index, ncol+value_inder, value)
    try:
        book2.save(path)
    except:
        print('请关闭股票表格后重新运行')
    # return book2



def write_excel(path,info_dict,path_save):
    name_list = ['zl','xl', 'zs','lb']
    # workbook = xlsxwriter.Workbook(path)  # 创建一个excel文件
    # worksheet = workbook.add_worksheet('sheet1')


    book = xlrd.open_workbook(path)  # 打开一个工作表
    sheetList = book.sheet_names()

    for index, name in enumerate(name_list):
        if name not in sheetList:
            bookad = copy(book)
            Sheetad = bookad.add_sheet(name)
            Sheetad.write(0, 0, '序号')
            Sheetad.write(0, 1, 'gp')
            # 在0行0列写入一行数据
            for i in range(1, 1000):
                Sheetad.write(i, 0, i)
            bookad.save(path)
            book = xlrd.open_workbook(path)  # 打开一个工作表
            sheet1 = book.sheet_by_name(name)  # 通过索引获取表
        else:
            sheet1 = book.sheet_by_name(name)  # 通过索引获取表



    gp = [i for i in sheet1.col_values(1) if len(i) > 0]
    nrow = len(gp)
    gp = gp[1:]
    book2 = copy(book)
    # sheet0 = book2.get_sheet(name)

    for sj in info_dict:
        for index, name in enumerate(name_list):
            ncol = book.sheet_by_name(name).ncols  # 表的列数
            info = info_dict[sj][index]
            book2.get_sheet(name).write(0, ncol, sj)

            for gp_index, gp_id in enumerate(gp):
                for info_text_index, info_text in enumerate(info[gp_id]):
                    book2.get_sheet(name).write(gp_index + 1, ncol + info_text_index, info_text)
                del info[gp_id]

            if info != None:
                info_dict_low = sorted(info.items(), key=lambda d: d[0])
                for key_index, key in enumerate(info_dict_low):
                    book2.get_sheet(name).write(nrow + key_index, 1, key[0])
                    for value_inder, value in enumerate(key[1]):
                        book2.get_sheet(name).write(nrow + key_index, ncol + value_inder, value)

    try:
        book2.save(path)
    except:
        print('请关闭股票表格后重新运行')
    try:
        shutil.copy(path, path_save)
    except:
        pass


